package main

import (
	"fmt"
	"strings"
)

func unique(intSlice []string) []string {
	keys := make(map[string]bool)
	list := []string{}
	for _, entry := range intSlice {
		if _, value := keys[entry]; !value {
			keys[entry] = true
			list = append(list, entry)
		}
	}
	return list
}

func find_uniq(input string, length int) {
	var buffer []string

	for i, c := range strings.Split(input, "") {
		buffer = append(buffer, c)

		if len(buffer) > length {
			buffer = buffer[1:]
		}

		if len(buffer) == length && len(unique(buffer)) == length {
			fmt.Printf("%d\n", i+1)
			break
		}
	}
}

func main() {
	input := ""

	find_uniq(input, 4)
	find_uniq(input, 14)
}
